  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0138029 contains raw underway
  meteorological, navigational, physical and time series data logged by the Scientific
  Computer System (SCS) aboard NOAA Ship Rainier in the Gulf of Alaska from 2015-09-28
  to 2015-10-10. Office of Marine and Aviation Operations (OMAO) personnel aboard
  the ship submitted these data and associated metadata to NODC. In addition, NODC
  Accession 0138029 contains supplementary cruise-level metadata, which OMAO personnel
  logged in the Ship Daily Activity Log (SDAL). OMAO and NODC personnel developed
  the automated process to archive these data under the auspices of the NOAA Rolling
  Deck to Repository (NOAA R2R) program.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
